import React from 'react'
import { useNavigate } from 'react-router-dom'

const ProductDetail = ({authenticate}) => {
  const navGate = useNavigate();
  return (
    authenticate ? (
      <div>
        디테일 페이지
      </div>
    ) : (
      navGate('/login')
    )
  )
}

export default ProductDetail
